import React from 'react';
//import logo from './logo.svg'; 
import './Profile.css'; 

class Profile extends React.Component {
    render() {
        return(
          <div className="Profile">
              <h1> Your Profile! </h1>
            <header>


                    <br></br> 
                    <br></br> 
                    Name:  
                    <input type="text" placeholder="Edit Name"/>
                    <button type="submit">Change</button>

                    <br></br>  
                    <br></br>   
                    <br></br>                    

                    Age: 
                    <br></br> 
                    <br></br> 
                    <br></br>   

                    Height: 
                    <br></br> 
                    <br></br>
                    <br></br>  

                    Weight:
                    <br></br> 
                    <br></br>
                    <br></br> 

                    About Me: 
                    <br></br> 
                    <br></br>
                    <br></br> 
                    <br></br> 


            </header>
            </div>
        );
    }
}

export default Profile; 

